import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axiosInstance from "../../baseurl";

function ViewTrainerPrograms() {
  const { id } = useParams();
  const [approvedpg, setapprovedpgm] = useState([]);

  useEffect(() => {
    console.log(id);
    axiosInstance
      .post(`/viewTutorialRequestsByPgmId/${id}`)
      .then((res) => {
        console.log(res, "approved programs");
        if(res.data.data!=undefined){
          setapprovedpgm(res.data.data)
        }
      })
      .catch((err) => {
        console.log(err);
      });
  });

  const apprfn = () => {};
  return (
    <div>
      
      {approvedpg.length?
      approvedpg.map((a)=>{
        return<div> {a._id}, {a.category}, {a.description} <button></button></div>
      }):null}
    </div>
  );
}

export default ViewTrainerPrograms;
